import './sectiontable.css'



export default function SectionTable(props) {
    
return (
	<table>
		<tr>
		<th></th>
		<th>Nama Mitra</th>
		<th>Action</th>
		</tr>
		{props.data.map((val, key) => {
		return (
			<tr key={key}>
			<td className='table-img'>{val.name}</td>
			<td>{val.age}</td>
			<td className='table-btn'>
                <button>edit</button>
                <button>delete</button>
            </td>
			</tr>
		)
		})}
	</table>
);
}
